import axios from "axios";
import { useState } from "react";

const DeleteWilder = ({key}) => {

    return (
        <form 
        onSubmit={(e) => {
            e.preventDefault();
            axios.delete("http://localhost:5000/api/wilder/{key}");
          }}
        >
        <button>Delete</button>
        </form>
    );
};

export default DeleteWilder;
